    "text" : "\uD398\uC544\uB178\uB974\uB294 \uB9CC\uC6E8\uC758 \uC625\uC88C \uC55E\uC5D0\uC11C \uD551\uACE8\uD540\uC744 \uB9CC\uB0AC\uACE0 \uC785\uC73C\uB85C\uB294 \uD654\uD574\uB97C \uD588\uB2E4. \uD551\uACE8\uD540\uC740 \uCE7C\uC744 \uAEBC\uB0B4 \uB4E4\uC5C8\uB358 \uC77C\uC5D0 \uB300\uD574\uC11C\uB294 \uC78A\uC5B4\uBC84\uB9AC\uC790\uACE0 \uD588\uB2E4. \uADF8\uB294 \uC190\uC744 \uB0B4\uBC00\uBA70 \uB9D0\uD588\uB2E4. \"\uC57D\uC18D\uD55C \uB300\uB85C \uD558\uC9C0\uC694. \uC800\uB294 \uD615\uB2D8\uC744 \uC6A9\uC11C\uD569\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uC544\uBB34\uB7F0 \uBD88\uB9CC\uC774 \uC5C6\uC2B5\uB2C8\uB2E4.\"",
